import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';

export default function Home() {
  return (
    <>
      {/* Navigation Bar */}
      <nav className="bg-blue-800 text-white p-4">
        <div className="max-w-6xl mx-auto flex justify-between items-center">
          <div className="text-xl font-semibold">
            <a href="/" className="text-white hover:text-gray-300">Yuvi's Artistry</a>
          </div>
          <div className="hidden md:flex space-x-6">
            <a href="#admin" className="hover:text-gray-300">Admin</a>
            <a href="#artist" className="hover:text-gray-300">Artist</a>
            <a href="#customer" className="hover:text-gray-300">Customer</a>
          </div>
          <div className="md:hidden">
            {/* Mobile Menu Button (Hamburger) */}
            <button className="text-white">
              <i className="fas fa-bars"></i>
            </button>
          </div>
        </div>
      </nav>

      {/* Main Content */}
      <div className="min-h-screen flex items-center justify-center bg-blue-100">
        <div className="text-center space-y-4">
          {/* Button Container */}
          <div className="flex justify-center space-x-6 flex-wrap">
            <Button variant="primary" className="btn-custom mb-4 sm:mb-0">Admin</Button>
            <Button variant="secondary" className="btn-custom mb-4 sm:mb-0">Artist</Button>
            <Button variant="success" className="btn-custom mb-4 sm:mb-0">Customer</Button>
          </div>
        </div>
      </div>

      {/* Carousel Section */}
      <div className="max-w-6xl mx-auto px-4 py-8">
        <Carousel
          autoPlay
          infiniteLoop
          showThumbs={false}
          showStatus={false}
          className="mb-10"
        >
          <div>
            <img src="/images/art1.jpg" alt="Art 1" className="w-full object-cover rounded-xl shadow-lg" />
            <p className="legend text-lg bg-opacity-70 bg-black text-white p-2">Art Title 1 - ₹999</p>
          </div>
          <div>
            <img src="/images/art2.jpg" alt="Art 2" className="w-full object-cover rounded-xl shadow-lg" />
            <p className="legend text-lg bg-opacity-70 bg-black text-white p-2">Art Title 2 - ₹1499</p>
          </div>
          <div>
            <img src="/images/art3.jpg" alt="Art 3" className="w-full object-cover rounded-xl shadow-lg" />
            <p className="legend text-lg bg-opacity-70 bg-black text-white p-2">Art Title 3 - ₹1999</p>
          </div>
          <div>
            <img src="/images/art4.jpeg" alt="Art 4" className="w-full object-cover rounded-xl shadow-lg" />
            <p className="legend text-lg bg-opacity-70 bg-black text-white p-2">Art Title 4 - ₹2499</p>
          </div>
          <div>
            <img src="/images/art5.jpeg" alt="Art 5" className="w-full object-cover rounded-xl shadow-lg" />
            <p className="legend text-lg bg-opacity-70 bg-black text-white p-2">Art Title 5 - ₹2999</p>
          </div>
        </Carousel>
      </div>

      <style>{`
        .min-h-screen {
          min-height: 100vh;
        }

        .btn-custom {
          padding: 12px 24px;
          font-size: 1rem;
          font-weight: bold;
          border-radius: 8px;
          transition: background-color 0.3s ease;
        }

        .btn-custom:hover {
          opacity: 0.9;
        }

        .btn-custom:focus {
          outline: none;
        }

        /* For each button's specific color */
        .btn-custom.btn-primary {
          background-color: #3182ce;
          border-color: #3182ce;
        }

        .btn-custom.btn-primary:hover {
          background-color: #2b6cb0;
          border-color: #2b6cb0;
        }

        .btn-custom.btn-secondary {
          background-color: #e2e8f0;
          border-color: #e2e8f0;
        }

        .btn-custom.btn-secondary:hover {
          background-color: #cbd5e0;
          border-color: #cbd5e0;
        }

        .btn-custom.btn-success {
          background-color: #38a169;
          border-color: #38a169;
        }

        .btn-custom.btn-success:hover {
          background-color: #2f855a;
          border-color: #2f855a;
        }

        /* Carousel Styles */
        .carousel .slide {
          background-color: #f3f4f6;
          width: 100%;
          height: 50vh;
        }

        .carousel .legend {
          font-size: 1.25rem;
          font-weight: bold;
          text-align: center;
          background: rgba(0, 0, 0, 0.7);
          color: white;
          padding: 10px;
          border-radius: 5px;
          margin-top: 5%;
        }

        .carousel .thumb {
          border-radius: 8px;
        }

        /* Responsive adjustments */
        @media (max-width: 768px) {
          .btn-custom {
            font-size: 0.9rem;
            padding: 10px 20px;
          }

          .carousel .legend {
            font-size: 1rem;
            padding: 8px;
          }

          .carousel .slide {
            height: 60vh;
          }

          /* Mobile Navigation Bar */
          .hidden {
            display: block;
          }
        }

        @media (max-width: 480px) {
          .btn-custom {
            font-size: 0.8rem;
            padding: 8px 16px;
          }

          .carousel .legend {
            font-size: 0.9rem;
            padding: 6px;
          }

          .carousel .slide {
            height: 50vh;
          }
        }
      `}</style>
    </>
  );
}
